import Card from 'react-bootstrap/Card';


const RecipeItem = (props) => {
    let quick_and_easy = null;
    let is_favorite = null;
    let have_made_before = null;

    if(props.quick_and_easy === true){
        quick_and_easy = 'quick and easy';
    }
    if(props.is_favorite === true){
        is_favorite = 'favorite'
    }
    if(props.have_made_before === true){
        have_made_before = 'made'
    }

    return (
        <Card>
            <Card.Header>
                {props.title}
            </Card.Header>
            <Card.Body>
                <h2>{props.image}</h2>
                <h6>{props.meat}</h6>
                <h6>{props.category}</h6>
                <h6>{props.rating}</h6>
                <h6>{quick_and_easy}</h6>
                <h6>{props.is_favorite}</h6>
                <h6>{props.have_made_before}</h6>
            </Card.Body>
        </Card>
    )
}

export default RecipeItem;
